import styles from './Titele.scss'
import { ScreenVersion } from '../Enums/headerEnums'

interface TiteleProps {
    version: ScreenVersion
}

export default function Titele(props: TiteleProps) {
    const { version } = props
    return (
        <header className={styles['header-titele__' + version]}>МЕНЕДЖЕР БРЕНДОВ</header>
    )
}
